import './Expense.css';
import Expensedate from './Expensedate';


const teslim = (props) =>{


    return (
<div className="expense-item">
    
<Expensedate date = {props.date}></Expensedate>
    <div className='expense-item_description'>
    title:{props.title}
  
   <h2>Age:{props.title}</h2> 
    
   
    </div>
</div>
    )


}
export default teslim;
